import React from "react";

export default class JugadoresPagina extends React.Component {

    constructor(props) {
        super(props);
        this.state = {
            jugador: [],
            loading: true,
        }
    }

     // Fetch player id 44 from API fthesportdb.com
    // https://www.thesportsdb.com/api/v1/json/2/lookupplayer.php?id=34162040
    // obtain firstnames, lastname, dateOfBirth, position,

    componentDidMount() {
        fetch("https://www.thesportsdb.com/api/v1/json/2/lookupplayer.php?id=34162040")
            .then(response => response.json())
            .then(data => {
                this.setState({
                    jugador: data.player[0],
                    loading: false,
                });
            });
    }

    render() {
        if (this.state.loading) {
            return <div>loading...</div>;
        }

        if (!this.state.jugador) {
            return <div>didn't get a player</div>;
        }

        return (
            <div>
                <h1>{this.state.jugador.strPlayer}</h1>
                <p>{this.state.jugador.dateBorn}</p>
                <p>{this.state.jugador.strPosition}</p>
            </div>
        );
    }
}
